import "./HomeCardStyle.css"

export default function HomeCard(){
    return (
        <>
            <div id="homecard">
                <div className="leftcard">
                    <li key={item.id}>
                        <div className="icon" style={{backgroundImage:`url(${item.icon})`}}></div>
                    </li>
                </div>
                <div className="rightcard">
    
                </div>
            </div>
        </>
    );
}
